import React from 'react';
import { FaEye, FaShare, FaChartLine } from 'react-icons/fa';
import './AnalyticsSidebar.css';

const AnalyticsSidebar = ({ articles }) => {
  const getTotalViews = () => {
    return articles.reduce((total, article) => total + article.analytics?.views || 0, 0);
  };

  const getTotalShares = () => {
    return articles.reduce((total, article) => total + article.analytics?.shares?.total || 0, 0);
  };

  const getTopArticles = () => {
    return [...articles]
      .sort((a, b) => (b.analytics?.views || 0) - (a.analytics?.views || 0))
      .slice(0, 5);
  };

  const getCategoryDistribution = () => {
    const distribution = articles.reduce((acc, article) => {
      const category = article.category || 'uncategorized';
      acc[category] = (acc[category] || 0) + 1;
      return acc;
    }, {});

    return Object.entries(distribution)
      .map(([category, count]) => ({
        category,
        percentage: (count / articles.length) * 100
      }));
  };

  return (
    <div className="analytics-sidebar">
      <h2>Analytics Overview</h2>
      
      <div className="analytics-cards">
        <div className="analytics-card">
          <FaEye className="icon" />
          <div className="card-content">
            <h3>Total Views</h3>
            <p>{getTotalViews()}</p>
          </div>
        </div>
        
        <div className="analytics-card">
          <FaShare className="icon" />
          <div className="card-content">
            <h3>Total Shares</h3>
            <p>{getTotalShares()}</p>
          </div>
        </div>
      </div>

      <div className="analytics-section">
        <h3>Top Articles</h3>
        <ul className="top-articles">
          {getTopArticles().map((article, index) => (
            <li key={article._id || index}>
              <span className="article-title">{article.title}</span>
              <span className="article-views">
                <FaEye /> {article.analytics?.views || 0}
              </span>
            </li>
          ))}
        </ul>
      </div>

      <div className="analytics-section">
        <h3>Category Distribution</h3>
        <div className="category-distribution">
          {getCategoryDistribution().map(({ category, percentage }) => (
            <div key={category} className="category-bar">
              <div className="category-label">
                {category.charAt(0).toUpperCase() + category.slice(1)}
              </div>
              <div className="bar-container">
                <div 
                  className="bar"
                  style={{ width: `${percentage}%` }}
                />
                <span className="percentage">{Math.round(percentage)}%</span>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AnalyticsSidebar;
